export default function HOOKS_USESTATE() {
  const {count,setCount} = useState(0);

  const increaseHandler = () =>{
     setCount(count + 1);
  }
  return (
    <div>
        <h>Count: {count}</h>
        <button onClick={increaseHandler}>+</button>
        <button onClick={increaseHandler} className="m-2">-</button>
    </div>
  )
}
